					["custom"] = "aura_env.phase = 1\naura_env.isMythic = false\n\naura_env.unit = \"boss1\"\n\naura_env.aegis = 244894 --Corrupt Aegis\naura_env.technique = 244688 --Taeshalach Technique\naura_env.spells = {\n    [245458] = 1, --Foe Breaker\n    [255059] = 1, --Empowered Foe Breaker\n    [245463] = 2, --Flame Rend\n    [255058] = 2, --Empowered Flame Rend\n    [245301] = 3, --Searing Tempest\n    [255061] = 3, --Empowered Searing Tempest\n}\n\naura_env.targets = {\n    \"tank\",\n    \"raid\",\n    \"aoe\",\n}\naura_env.target = nil\n\naura_env.regularOrder = {\n    1,\n    2,\n    1,\n    2,\n    3\n}\n\naura_env.clearCombo = function()\n    aura_env.combo = 0\n    aura_env.prev = {}\n    aura_env.counts = {\n        0,\n        0,\n        0,\n    }\nend\naura_env.clearCombo()\n\naura_env.getNextSpells = function()\n    if not aura_env.isMythic then\n        local next = aura_env.combo + (aura_env.target and 2 or 1)\n        return aura_env.targets[aura_env.regularOrder[next]]\n    else\n        local result = \"\"\n        for i = 1, 2 do\n            local add = \"\"\n            local other = (i % 2) + 1\n            if aura_env.counts[i] < 2 and aura_env.counts[i] <= aura_env.counts[other] then\n                add = aura_env.targets[i]..(aura_env.counts[i] + 1)\n            end\n            if result:len() > 0 and add:len() > 0 then\n                result = result..\"\\n\"\n            end\n            result = result..add\n        end\n        if aura_env.counts[3] == 0 then\n            if result:len() > 0 then\n                result = result..\"\\n\"\n            end\n            result = result..aura_env.targets[3]\n        end\n        return result\n    end\nend\n\n--frame stuff\nlocal bar = WeakAuras.regions[aura_env.id].region.bar\naura_env.widthPerSegment = bar:GetWidth() / 5\nif not bar.sparks then bar.sparks = {} end\nfor i = 1, 4 do\n    if bar.sparks[i] then bar.sparks[i]:Hide() end\n    local spark = bar:CreateTexture(nil, \"ARTWORK\")\n    spark:SetDrawLayer(\"ARTWORK\", 4)\n    spark:SetTexture(bar.spark:GetTexture())\n    spark:SetWidth(bar.spark:GetWidth())\n    spark:SetHeight(bar.spark:GetHeight())\n    spark:SetBlendMode(bar.spark:GetBlendMode())    \n    spark:ClearAllPoints()\n    spark:SetPoint(\"LEFT\", bar, \"LEFT\", aura_env.widthPerSegment*i, 0)\n    bar.sparks[i] = spark\nend\nif not bar.texts then bar.texts = {} end\nfor i = 1, 5 do\n    if bar.texts[i] then bar.texts[i]:Hide() end\n    local text = bar:CreateFontString(nil, \"OVERLAY\", \"GameFontHighlight\")\n    text:SetWidth(aura_env.widthPerSegment)\n    text:SetHeight(bar:GetHeight())\n    text:SetWordWrap(true)\n    bar.texts[i] = text\nend\nif bar.cast then bar.cast:Hide() end\nlocal cast = bar:CreateTexture(nil, \"ARTWORK\")\ncast:SetDrawLayer(\"ARTWORK\", 3)\ncast:SetTexture(bar:GetTexture())\ncast:SetBlendMode(\"ALPHAKEY\")\ncast:SetVertexColor(bar:GetVertexColor())\ncast:SetWidth(1)\ncast:SetHeight(bar:GetHeight())\nbar.cast = cast\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
