				["customDuration"] = "function()\n    local DKRune1start, DKRune1duration, DKRune1runeReady = GetRuneCooldown(1)\n    local DKRune2start, DKRune2duration, DKRune2runeReady = GetRuneCooldown(2)\n    local DKRune3start, DKRune3duration, DKRune3runeReady = GetRuneCooldown(3)\n    local DKRune4start, DKRune4duration, DKRune4runeReady = GetRuneCooldown(4)\n    local DKRune5start, DKRune5duration, DKRune5runeReady = GetRuneCooldown(5)\n    local DKRune6start, DKRune6duration, DKRune6runeReady = GetRuneCooldown(6)\n    \n    local ipseDKRuneTableStart = { \n        DKRune1start, \n        DKRune2start, \n        DKRune3start, \n        DKRune4start,\n        DKRune5start,\n        DKRune6start\n    }\n    \n    local ipseDKRuneTableDuration = { \n        DKRune1duration, \n        DKRune2duration, \n        DKRune3duration, \n        DKRune4duration,\n        DKRune5duration,\n        DKRune6duration\n    }\n    \n    if aura_env.DynamicRunes == true then\n        \n        table.sort(ipseDKRuneTableStart)\n        table.sort(ipseDKRuneTableDuration)\n    end\n    aura_env.DKRune5Duration = ipseDKRuneTableDuration[5]\n    aura_env.DKRune5Start = ipseDKRuneTableStart[5]\n    if ipseDKRuneTableStart[5] == 0 then\n        return 0,0\n    else\n        return ipseDKRuneTableStart[5] - GetTime() + ipseDKRuneTableDuration[5], ipseDKRuneTableDuration[5], true\n        \n    end\nend\n\n\n\n\n",
