			["customText"] = "function()\n    \n    local E_global_overflow = 0\n    local powerType = 8\n    local curASP = UnitPower('player', powerType)\n    local maxPower = UnitPowerMax('player', powerType)\n    local Predict_AP = 0\n    local Predict_non_fill = 0\n    local ca_mod = 1\n    local bota_mod = 1\n    local SpellCast = UnitCastingInfo('player')\n    local BOTA = UnitBuff('player', aura_env.bota_spell, false, \"PLAYER\")\n    \n    local CA = select(4, GetTalentInfo(5, 2, 1)) -- says if Incarnation is selected or not\n    \n    if CA then CA = aura_env.inc else CA = aura_env.ca end -- confirming variable for CA or INC\n    \n    local BUFF = UnitBuff('player', CA, false, \"PLAYER\") -- declaring CA or INC\n    \n    if select(1,BOTA) == aura_env.bota_spell then -- blessing of elune modifier\n        bota_mod = 1.25\n    end\n    \n    if select(1,SpellCast) == aura_env.lunarStrike  then\n        Predict_AP = 12\n    elseif select(1,SpellCast) == aura_env.solarWrath then\n        Predict_AP = 8\n    elseif select(1,SpellCast) == aura_env.newMoon then -- New Moon\n        Predict_non_fill = 10\n    elseif select(1,SpellCast) == aura_env.halfMoon then -- Half Moon\n        Predict_non_fill = 20\n    elseif select(1,SpellCast) == aura_env.fullMoon then -- Full Moon\n        Predict_non_fill = 40\n    elseif select(1,SpellCast) == aura_env.stellarFlare then -- Stellar Flare\n        Predict_non_fill = (-10)\n    end\n    \n    \n    if not BUFF == false then -- predicting spellcast finishing before CA/INC expires\n        ca_mod = 1.5\n        if not UnitCastingInfo('player') == false then -- casting spells\n            if select(7,UnitBuff('player', CA, false, \"PLAYER\"))-GetTime() < select(6,UnitCastingInfo('player'))/1000-GetTime() then -- if our buff expires \n                ca_mod = 1\n            end\n        end\n    end\n    \n    E_global = abs(curASP)+Predict_non_fill+(Predict_AP*ca_mod*bota_mod) or 0\n    \n    --E_global is our predicted AP value after all modifiers\n    \n    if E_global >= maxPower then\n        E_global_overflow = E_global\n        \n        \n        if E_global_overflow > 0 then\n            E_global = maxPower\n        end\n        \n    end\n    \n    if E_global <= 0 or E_global == nil then\n        E_global = 0\n    end\n    \n    if aura_env.predict == false then\n        return string.format(\"%.0f\", curASP)\n    end\n    \n    if E_global_overflow ~= nil and E_global_overflow >= maxPower+1 then\n        if aura_env.decimal == false then\n            E_global_overflow = math.floor(E_global_overflow)\n        end\n        return (\"|cffFF0000*\"..E_global_overflow..\"*|r\")\n    else\n        if aura_env.decimal == true then\n            return E_global\n        else\n            return (string.format(\"%d\",E_global))\n        end\n    end\n    \n    \nend",
