				["custom"] = "function()\n    if GetTime()-(aura_env.LastScan or 0) < 0.3 then return end \n    aura_env.LastScan=GetTime()\n    aura_env.everyFrame()\n    \n    if GetCVar(\"nameplateShowEnemies\") == \"1\" then\n        \n        local display = false\n        for i = 1, 40 do\n            local unit = \"nameplate\"..i\n            if UnitName(unit) == \"Уголек Тайшалака\" then\n                local power = UnitPower(unit, 3)\n                if power then\n                    \n                    aura_env.addTextureToNameplate(unit, false, 40, 1, 1, 1, 1, power) \n                end\n            end\n        end\n    end\nend\n\n\n\n\n\n",
